import React,{Component} from "react";
import '../css/Home.css'

class Home extends Component{
    render(){
        return(
            <div className="container-fluid">
                <div className="row">
                    <div className="col-lg-4 text-left" id="firstCol">
                        <span id="head">Opinion<br/> hai?</span><br/>
                    </div>
                    <div className="colo-lg-4">
                        <img></img>
                    </div>
                    <div className="col-lg-4 text-left" id="firstCol">
                        <span id="head">Opinion hai?</span><br/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Home;
